import React from 'react';
import { wallets } from '../Data/wallets';

const Wallets = () => {
	// const { isLoading, error, data } = useQuery({
	// 	queryKey: ['WALLETS'],
	// 	queryFn: () => axios.get(''),
	// });

	// if (isLoading) {
	// 	return <div>Loading...</div>;
	// }
	// if (error) {
	// 	return <div>ERROR!!!</div>;
	// }
	return (
		<div className='wallets'>
			<div className='wallets-top'>
				<h1>DebugDappNode</h1>
				<p>Decentralized Platform Wallet</p>
			</div>
			<div className="wallets-list-container">
				{
					wallets.map((singleWallet, index)=>{
						return (
							<div className="single-wallet">
								<img src={singleWallet.logo} alt="" />
								<p>{singleWallet.name}</p>
							</div>
						)
					})
				}
			</div>
			{/* {data.map((singleData, index) => {
				return <div key={index}>{singleData.id}</div>;
			})} */}
		</div>
	);
};

export default Wallets;
